import React from 'react';
import Header from './components/Header';
import Footer from './components/Footer';

function App() {
  return (
    <>
      <header className="App-header">
        <a href="/">Charity Management system</a>
      </header>
      <main>
        <h1>Charity list</h1>
      </main>
    </>
  );
}

export default App;
